---combined last sales date and item data
WITH 
inventory AS (
SELECT limcu, liitm, lipqoh, lipreq, lipcom, lilrcj lastreceipt, lincdj, liupmj lastupdates FROM WORLD_PRODUCTION.WORLD.F41021 a WHERE limcu='ON3' ORDER BY 1,2  
),
sales AS (
SELECT sdmcu, sditm, sdlitm, max(sdupmj) LastSales, count(*) SalesRecords
FROM WORLD_PRODUCTION.WORLD.F42119
WHERE  sdmcu='ON3' AND sddcto IN ('DT','S6','S7','SI','ST','SZ') 
GROUP BY sdmcu, sditm, sdlitm
ORDER BY 1,2,3
),
inventorysales AS (
SELECT i.*, lastsales ,
CASE
    WHEN YEAR(lastsales) = 2024 THEN '1'
    WHEN YEAR(lastsales) = 2023 THEN '2'
    WHEN YEAR(lastsales) = 2022 THEN '3'
    WHEN YEAR(lastsales) = 2021 THEN '4'
    WHEN YEAR(lastsales) = 2020 THEN '5'
    ELSE '6'
END AS lastsalescode,
CASE
    WHEN YEAR(lastreceipt) = 2024 THEN '1'
    WHEN YEAR(lastreceipt) = 2023 THEN '2'
    WHEN YEAR(lastreceipt) = 2022 THEN '3'
    WHEN YEAR(lastreceipt) = 2021 THEN '4'
    WHEN YEAR(lastreceipt) = 2020 THEN '5'
    WHEN YEAR(lastupdates) = 2024 THEN '1'
    WHEN YEAR(lastupdates) = 2023 THEN '2'
    WHEN YEAR(lastupdates) = 2022 THEN '3'
    WHEN YEAR(lastupdates) = 2021 THEN '4'
    WHEN YEAR(lastupdates) = 2020 THEN '5'
    ELSE '6'
END AS lastmovemcode , 
lastsalescode||lastmovemcode Code,
CASE
    WHEN lipqoh <> 0 THEN 'Y'
    WHEN lipreq <> 0 THEN 'Y'
    WHEN lipcom <> 0 THEN 'Y'
    ELSE 'N'
END AS availinventorycode
FROM inventory i LEFT JOIN sales s ON limcu = sdmcu AND liitm = sditm
),
--- item data
itemdata as(
SELECT ibmcu, ibitm, iblitm, ibaitm, ibstkt, imuom1 ---, bteqty,IDGWID,IDGDEP,idghet, idgwei   
FROM E1_PRODUCTION.E1.F4102  a 
INNER JOIN E1_PRODUCTION.E1.F4101    ON ibitm = imitm
--INNER JOIN E1_PRODUCTION.E1.F550023b ON ibitm = btitm AND ibmcu  = btmcu 
--INNER JOIN E1_PRODUCTION.E1.F46091   ON ibmcu = idmcu AND bteqty = ideqty
WHERE ibmcu='ON3'
),
-- group 
outfile AS (
--SELECT i.*, ibaitm, ibstkt, imuom1, bteqty, idgwid, idgdep,idghet, idgwei  FROM inventorysales i LEFT JOIN itemdata id ON i.liitm = id.ibitm
SELECT i.*, ibaitm, ibstkt, imuom1 FROM inventorysales i inner JOIN itemdata id ON i.liitm = id.ibitm
)
--SELECT Code,lastsalescode,lastmovemcode,availinventorycode, ibstkt, count(*) FROM outfile GROUP BY Code,lastsalescode,lastreceiptcode,availinventorycode, ibstkt ORDER BY 1
SELECT * FROM outfile WHERE liitm=1660556
ORDER BY 2 --WHERE code='61' AND availinventorycode='Y' --AND ibstkt='O'
;
